insert into mineral (nombre_mineral,valor_economico,descripcion_mineral,tipo_mineral)
values('Cal','Bajo','Usado desde la antigüedad en la construcción de viviendas, e incluso en el pintado de las mismas.','No metalico'),
('Caliza','Medio','Encontrado comúnmente en la naturaleza como reservorio de hidrocarburos. Usado para la fabricación de cemento.','No metalico'),
('Granito','Medio','Es el principal tipo de roca en la corteza terrestre. Usado en la construcción de viviendas y de edificios públicos debido a su durabilidad.','No metalico'),
('Yeso','Bajo','Utilizado en la fabricación de cemento y el dry-wall,como aislante térmico, así como para la fabricación de moldes y tizas para pizarra.','No metalico'),
('Arcilla','Bajo','Ha sido usada para la fabricación de ladrillo, porcelana y loza, así como en procesos industriales como el de fabricación de cemento y papel.','No metalico'),
('Azufre','Medio','Usada para la fabricación de baterías de auto, pólvora, como fertilizante en la agricultura y como fungicida (anti hongos), en la orfebrería para la oxidación de la plata,etc','No metalico'),
('Baritina','Medio','Es empleada como pigmento, en la fabricación de agua oxigenada, para la preparación de lodos usados en la extracción de petróleo y gas natural, en la fabricación de resinas sintéticas y vidrio.','No metalico'),
('Bentonita','Medio','Usada en las construcciones para el sostenimiento de tierras y como material de sellado, para la elaboración de lubricantes, en la elaboración de lodos para la extracción de los hidrocarburos, entre otros.','No metalico'),
('Carbon Antracita','Bajo','Es usado como combustible en las más diversas industrias: generación de energía eléctrica, fundiciones, cementera, e incluso para uso doméstico.','No metalico'),
('Mica','Medio','Gracias a su resistencia al calor, así como por su elasticidad, es usado como aislante eléctrico y térmico para la protección de máquinas.','No metalico'),
('Sal Comun','Bajo','Se encuentra en las salineras y es usada ampliamente en la cocina universalmente para condimentar y conservar alimentos.','No metalico'),
('Talco','Bajo','Es usado en diversas industrias entre ellas para la fabricación de papel, en la industria cosmética para prevenir la irritación de la piel, e incluso como parte de algunos plásticos.','No metalico')
